import React, { Component } from 'react';
import './App.css';
import axios from 'axios'; 



class App extends Component {
  constructor () {
    super();
    this.state = {
      q: [],
    }
  }

  componentDidMount() {
    this.getTweets();
  }

  getTweets = async () => {
      const resp = await axios.get('https://api.twitter.com/1.1/search/tweets.json', {
        params: {
          q: '@aoc'
        }
      })
      .then(function (resp) {
        console.log(resp);
      })
      .catch(function (error) {
        console.log(error);
      });
      return resp.data;
      // console.log(resp.data);
    }


  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
